import './Contact.css'

import discount from './seniorDiscount.jpg';

const Contact = () => {
  return (
    <div>
      <div className='flex flex-col'>
        <p className='text-center text-xl p-2'>You may contact us directly through phone call or text message for a free quote, preferably during office hours however we do handle emergency situations 24 hours a day as well.</p>
        <a className='text-blue-300 text-2xl bg-blue-900 p-8 text-center m-2 rounded-lg shadow-lg shadow-black hover' href='tel:661-202-8255'>Call or text now! 661-202-8255</a>
      </div>
      <div>
        <p className='text-center text-xl'>Dont forget about our discounts we offer as shown below!</p>
        <div>
          <img src={discount}></img>
        </div>
      </div>
    </div>
  );
};


export default Contact;
